import React from "react";

const Stars = () => {
  let buttonText = "GOOD?";
  const HandleClick = () => {
    if (buttonText === "GOOD?") {
      buttonText = "GOOD";
    } else {
      buttonText = "GOOD?";
    }
  };

  return <button onClick={HandleClick}>{buttonText}</button>;
};

export default Stars;
